// DashboardPage.js

import React, { useState, useEffect } from 'react';

const DashboardPage = () => {
  // Sample data for student's grades
  const [grades, setGrades] = useState([
    { subject: 'Math', grade: 90 },
    { subject: 'English', grade: 85 },
    // Add more subjects and grades as needed
  ]);

  // Sample data for missing grades
  const [missingGrades, setMissingGrades] = useState([
    { subject: 'Science' },
    // Add more missing subjects as needed
  ]);

  useEffect(() => {
    // Simulate fetching data or checking for missing grades from an API
    // You can replace this with actual data fetching logic
    // For simplicity, we'll use a setTimeout to simulate an asynchronous operation
    const fetchData = () => {
      setTimeout(() => {
        // Sample updated grades data
        const updatedGrades = [
          { subject: 'Math', grade: 90 },
          { subject: 'English', grade: 85 },
          { subject: 'Science', grade: 92 }, // Updated grade for Science
          // Add more subjects and grades as needed
        ];

        // Sample updated missing grades data
        const updatedMissingGrades = [
          // No missing grades after the update
        ];

        setGrades(updatedGrades);
        setMissingGrades(updatedMissingGrades);
      }, 2000); // Simulating a 2-second delay
    };

    fetchData();
  }, []);

  return (
    <div className="dashboard-container">
      <h1>Dashboard Page</h1>

      <div className="grades-section">
        <h2>Current Grades</h2>
        <ul>
          {grades.map((grade, index) => (
            <li key={index}>
              {grade.subject}: {grade.grade}
            </li>
          ))}
        </ul>
      </div>

      <div className="alerts-section">
        <h2>Alerts/Notifications</h2>
        {missingGrades.length === 0 ? (
          <p>No missing grades. Great job!</p>
        ) : (
          <ul>
            {missingGrades.map((missingGrade, index) => (
              <li key={index}>
                Missing grade for {missingGrade.subject}
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default DashboardPage;
